import React, { useState } from 'react';
import PropertyManagement from './PropertyManagement';
import CottageManagement from './CottageManagement';
import './Settings.css';

const Settings: React.FC = () => {
  const [activeTab, setActiveTab] = useState<'properties' | 'cottages'>('properties');

  return (
    <div className="card">
      <h2>Settings</h2>

      <div className="settings-tabs">
        <button
          className={`tab-button ${activeTab === 'properties' ? 'active' : ''}`}
          onClick={() => setActiveTab('properties')}
        >
          üè† Properties
        </button>
        <button
          className={`tab-button ${activeTab === 'cottages' ? 'active' : ''}`}
          onClick={() => setActiveTab('cottages')}
        >
          üè° Cottages
        </button>
      </div>

      <div className="settings-content">
        {activeTab === 'properties' && <PropertyManagement />}
        {activeTab === 'cottages' && <CottageManagement />}
      </div>
    </div>
  );
};

export default Settings;
